import Header from './header.js';
import Footer from './footer.js';
import Form from './selector.js';
import Result from './results.js';
import './style.scss';

class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      count: 0,
      results: []
    }
  }

  render() {
    return(
      <div>

        <Header />
        <Form />
        <Result />
        <Footer />

      </div>
    )
  }
}

export default App;
